import React, { useState } from "react";
import axios from "axios";

var APOD = () => {
  const [data, setData] = useState();
    axios
      .get("https://api.nasa.gov/planetary/apod?api_key=m5qSFJLeqz6oshoKMC0S8QChxUfWerz4VdqOiFo8")
      .then(function (response) {
        setData(response.data);
        console.log(data);
        return (
          <>
            <div className="card lg:card-side main-card card-bordered">
              <figure>
      
                <img src={data.hdurl} className="apod" />
              </figure>
              <div className="card-body">
                <h2 className="card-title">Horizontal</h2>
                <p>lol this is gud</p>
                <div className="card-actions">
                  <button className="btn btn-primary">Get Started</button>
                  <button className="btn btn-ghost">More info</button>
                </div>
              </div>
            </div>
          </>
        );
      })
      .catch(function (error) {
        // handle error
        console.log(error);
      })
      .then(function () {
        // always executed
      });
  
};
export default APOD;
